import { useForm } from "react-hook-form";
import authHeader from "../Appservices/auth-header";
import { useLoginstore } from "./useLoginstore";

const Login = () => {
  const { setLoggedIn } = useLoginstore((store) => ({
    setLoggedIn: store.setLoggedIn,
  }));

  const { register, handleSubmit } = useForm();

  const onSubmit = (submitdata) => {
    const URL = "https://api.mediehuset.net/token";

    const fetchResults = async () => {
      try {
        fetch(URL, { body: submitdata, method: "POST", headers: authHeader() })
          .then((response) => response.json())
          .then((data) => console.log(data));
      } catch (error) {
        console.log(error);
      }
    };
    fetchResults();
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input {...register("username", { required: "Brugernavn er påkrævet" })} type="text" autoComplete="username" placeholder="brugernavn" />

      <input
        {...register("password", { required: "Password er et påkrævet felt" })}
        type="password"
        autoComplete="password"
        placeholder="Dit password"
      />
      <button>login</button>
    </form>
  );
};

export default Login;
